import React from 'react';
import './navbar.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import {faArrowDown, faBars, faHome, faLink, faMoneyBill} from "@fortawesome/free-solid-svg-icons";


const navbar = () => {
    return ( 
        <div className={'Navbar'}>
            <div className={'LogoName'}> <FontAwesomeIcon icon={faBars}/> My First React Website</div>
            <div className={'NavLinks'}>
                <div className={'NavLink'}><FontAwesomeIcon icon={faHome} style={{marginRight: 8}}/>Home<FontAwesomeIcon icon={faArrowDown} style={{marginLeft: 3}}/></div>
                <div className={'NavLink'}><FontAwesomeIcon icon={faLink} style={{marginRight: 8}}/>Features</div>
                <div className={'NavLink'}><FontAwesomeIcon icon={faMoneyBill} style={{marginRight: 8}}/>Pricing</div>
                <button className="btn btn-light"><p>Buy Now</p></button>
            </div>
        </div>
     );
}

export default navbar;
